import React from 'react';

import './TopBar.css';
import logo from '../../Images/B2CSlogo.png';
const TopBar = props => {
    return (
        <div className="topBar">
            <div className="topBar_left">
                <img 
                    className="topBar_logo"
                    src={logo}
                    alt=""
                />
            </div>
            <div className="topBar_center">
                Test
            </div>
            <div className="topBar_right">
                Test 2
            </div>
        </div>
    );
};

export default TopBar;
